import React from 'react'
import ReactDOM from 'react-dom'
import './react-video-categorycard.css'

function VideoCategoryCard(props)
{
    return(
        <div class="video-category-card">
            <iframe 
            width="560" 
            height="315" 
            src={props.url + "?controls=0"} 
            frameborder="0" 
            allow="accelerometer; encrypted-media; gyroscope; picture-in-picture" 
            allowfullscreen>
            </iframe>
        </div>
    )
}

export default {VideoCategoryCard}
